import { AnalyzerResult, AnalyzerResultExecutionStatus, analyzersClient } from '@dynatrace-sdk/client-davis-analyzers';

// DECLARE GLOBAL VARIABLES
let upperBoundDavisForecast = -Infinity;
let medianDavisForecast: number[] = [];
let lowerBoundDavisForecast = Infinity;
let upperValues: number[] = [];
let lowerValues: number[] = [];
let upperIndices: number[] = [];
let lowerIndices: number[] = [];
let resultLength = 0;
let upperTimestamp: number[] = [];
let lowerTimestamp: number[] = [];
let upperDates: string[] = [];
let lowerDates: string[] = [];
let hostNames: string[] = [];
let timeframe: string;

// pollExecution function retries the Davis Analyzer if it fails
// Attempt and timeout limits set within the function
export const pollExecution = async (analyzerName: string, requestToken: string): Promise<AnalyzerResult> => {
  const MAX_ATTEMPTS = 10;
  const INTERVAL_MS = 1000;
  let attempts = 0;

  while (attempts < MAX_ATTEMPTS) {
    await new Promise((resolve) => setTimeout(resolve, INTERVAL_MS));

    const { result } = await analyzersClient.pollAnalyzerExecution({
      analyzerName,
      requestToken,
    });

    if (result.executionStatus === AnalyzerResultExecutionStatus.Completed) {
      return result;
    }

    if (result.executionStatus === AnalyzerResultExecutionStatus.Aborted) {
      throw new Error('The analyzer execution was aborted');
    }

    attempts++;
  }

  const cancelResponse = await analyzersClient.cancelAnalyzerExecution({
    analyzerName,
    requestToken,
  });

  if (cancelResponse && cancelResponse.result.executionStatus === AnalyzerResultExecutionStatus.Completed) {
    return cancelResponse.result;
  }

  throw new Error('Max polling retries reached');
};

// loadForecast - executes the DQL query against the GenericForecastAnalyzer
export const loadForecast = async (query: string) => {
  const analyzerName = 'dt.statistics.GenericForecastAnalyzer';
  const response = await analyzersClient.executeAnalyzer({
    analyzerName,
    body: {
      timeSeriesData: {
        expression: query,
      },
    },
  });

  const analysisResult = response.requestToken
    ? await pollExecution(analyzerName, response.requestToken)
    : response.result;

  if (analysisResult.executionStatus === AnalyzerResultExecutionStatus.Completed) {

    analysisResult.output.forEach(analyzerOutput => {
    if (analyzerOutput.timeSeriesDataWithPredictions && analyzerOutput.timeSeriesDataWithPredictions.records) {

        analyzerOutput.timeSeriesDataWithPredictions.records.forEach(record => {
            let upperIterator = 0;
            let lowerIterator = 0;
            let upperIndex = 0;
            let lowerIndex = 0;

            timeframe = record["timeframe"];
            if (Array.isArray(record["dt.davis.forecast:upper"])) {
                resultLength = record["dt.davis.forecast:upper"].length;
                record["dt.davis.forecast:upper"].forEach(value => {
                    const upperValue = parseFloat(value);
                    if (upperValue > upperBoundDavisForecast) {
                        upperBoundDavisForecast = upperValue;
                        upperIndex = upperIterator;                  
                    }
                    upperIterator++;
                });
            }

            //console.log("Upper");
            //console.log(upperIndex);
            //console.log(upperBoundDavisForecast);
            hostNames.push(record["host.name"]);
            upperValues.push(upperBoundDavisForecast);
            upperIndices.push(upperIndex);
            upperBoundDavisForecast = -Infinity;

            if (Array.isArray(record["dt.davis.forecast:lower"])) {
                record["dt.davis.forecast:lower"].forEach(value => {
                    const lowerValue = parseFloat(value);
                    if (lowerValue < lowerBoundDavisForecast) {
                        lowerBoundDavisForecast = lowerValue;
                        lowerIndex = lowerIterator; 
                    }
                    lowerIterator++;
                });
            }

            lowerValues.push(lowerBoundDavisForecast);
            lowerIndices.push(lowerIndex);
            lowerBoundDavisForecast = Infinity;
        });
    }
});

  }

};

// DEFAULT HANDLER
// Needs to return an array with the results
export default async function () {
  // SET THIS QUERY TO THE ONE FROM THE PREVIOUS STEP
  //const dqlQuery = "timeseries avg(dt.host.cpu.usage), from:now()-7d, to:now(), interval:100m, by: { host.name } | limit 50";
  const dqlQuery = "timeseries avg(dt.host.cpu.usage), from:now()-7d, to:now(), interval:100m, by: { host.name } | limit 50";

  await loadForecast(dqlQuery).then(() => {
    console.log('Forecast loaded successfully');

  }).catch((error) => {
    console.error('Error loading forecast:', error);
  });

  const startEpoch = new Date(timeframe.start).getTime();
  const endEpoch = new Date(timeframe.end).getTime();
  const totalEpochTime = endEpoch - startEpoch;

  let timePerPoint = totalEpochTime/resultLength;
  const timeArray: number[] = [];

  upperTimestamp = upperIndices.map(element => element * timePerPoint); 
  lowerTimestamp = lowerIndices.map(element => element * timePerPoint);

  for (let i = 0; i < upperTimestamp.length; i++) {
    const upperDate = new Date(upperTimestamp[i]+startEpoch);
    const lowerDate = new Date(lowerTimestamp[i]+startEpoch);
    upperDates.push(upperDate.toISOString());
    lowerDates.push(lowerDate.toISOString());
  }

  console.log(timeframe);
  const combinedArray = upperValues.map((value, index) => ({
    hostName: hostNames[index],
    upperBound: value,
    upperDate: upperDates[index],
    lowerBound: lowerValues[index],
    lowerDate: lowerDates[index]
  }));

  return combinedArray; 
}

