```
import { execution } from '@dynatrace-sdk/automation-utils';

    const TASK_ID = 'analyze_with_davis_1';

    export default async function ({ execution_id }) {
    const exe = await execution(execution_id);
    const predResult = await exe.result(TASK_ID);
    const result = predResult['result'];
    //const predictionSummary = { violation: false, violations: new Array<Record<string, string>>() };
    console.log("Total number of analyzed lines: " + result.output.length);

    let alertCount = 0;
    let startTime: string[] = [];
    let endTime: string[] = [];
    let inputDQL: string = "";

    if (result.resultStatus == 'SUCCESSFUL' && result.executionStatus == 'COMPLETED') 
    {
        console.log('Analysis was successful.')

        for (let i = 0; i < result.output.length; i++) 
        {
          const prediction = result.output[i];
          // Check if the analysis result is considered valid
          if (prediction.analysisStatus == 'OK') {

            // Set the input DQL into the body of the alert email
            inputDQL = result.input.timeSeriesData;

            if (prediction.dimensions[0].key == "potentialAlerts")
            {
                alertCount = prediction.dimensions[0].value;
                for (let j = 0; j < alertCount; j++)
                {
                  startTime[j] = prediction.raisedAlerts[j].timeframe.startTime;
                  endTime[j] = prediction.raisedAlerts[j].timeframe.endTime;
                }
            }
          }
        }
        console.log("Start time");
        console.log(startTime);
        console.log("End time");
        console.log(endTime);

        let alertString: string = "";
        if (startTime.length == 0)
        {
          alertString = "No alerts detected by Davis.";    
        }
        else
        {
          for (let i = 0; i < startTime.length; i++)
          {
            let numInc = i + 1;
            let startDate = new Date(startTime[i]);
            let endDate = new Date(endTime[i]);

            // Options for formatting the date
            const options: Intl.DateTimeFormatOptions = {
              year: 'numeric',
              month: 'long',
              day: 'numeric',
              hour: '2-digit',
              minute: '2-digit',
              second: '2-digit',
              timeZoneName: 'short'
            };

            // Convert to a readable format
            const startDateFinal = startDate.toLocaleDateString('en-US', options);
            const endDateFinal = endDate.toLocaleDateString('en-US', options);

            if (i == 0)
            {
              alertString = "Input DQL: " + inputDQL;
              alertString = alertString + "\n\n" + "Alert #" + numInc.toString() + " predicted to occur starting at " + startDateFinal + " and ending at " + endDateFinal + ".";
            }
            else 
            {
              alertString = alertString + "\n\n" + "Alert #" + numInc.toString() + " predicted to occur starting at " + startDateFinal + " and ending at " + endDateFinal + ".";
            }
          }
        }
        return alertString;
    } 
    else 
    {
        console.log('Analysis failed!');
    }
 }
